import React from "react";
import "./Contact.css";

function Contact() {
  return (
    <div className="contact-page">
      <h1>Contact Me</h1>
      <p><strong>Email:</strong> yourname@example.com</p>
      <p><strong>GitHub Profile: </strong> <a href="https://github.com/talha-xml" target="_blank" rel="noopener noreferrer">https://github.com/talha-xml</a> </p>
      <p><strong>LinkedIn Profile: </strong><a href="https://www.linkedin.com/in/talha-faizan-46158532a/" target="_blank" rel="noopener noreferrer">https://www.linkedin.com/in/talha-faizan-46158532a/</a></p>
    </div>
  );
}

export default Contact;
